using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using FullContactDotNet;

namespace UnitTests
{
    [TestClass]
    public class FullContactCardReaderApiUnitTests
    {
        private static string FrontImageBase64Encoded = "";
        private static string BackImageBase64Encoded = "";
        private static string WebHookUrl = "https://api.webhooksrus.com/feedme";

        [TestMethod]
        [ExpectedException(typeof(ArgumentNullException),
            "FullContactApi was allowed to upload a card with a null front image.")]
        public void FullContactCardReaderApiUploadCardNullFrontImageBase64String()
        {
            var fullContactCardReaderApi = new FullContactCardReaderApi();
            var actual = fullContactCardReaderApi.UploadCard(null, BackImageBase64Encoded, WebHookUrl);
        }

        [TestMethod]
        [ExpectedException(typeof(ArgumentNullException),
            "FullContactApi was allowed to upload a card with a empty front image.")]
        public void FullContactCardReaderApiUploadCardEmptyFrontImageBase64String()
        {
            var fullContactCardReaderApi = new FullContactCardReaderApi();
            var actual = fullContactCardReaderApi.UploadCard(" ", BackImageBase64Encoded, WebHookUrl);
        }

        [TestMethod]
        [ExpectedException(typeof(ArgumentNullException),
            "FullContactApi was allowed to upload a card with a null webhook url.")]
        public void FullContactCardReaderApiUploadCardNullWebhookUrl()
        {
            var fullContactCardReaderApi = new FullContactCardReaderApi();
            var actual = fullContactCardReaderApi.UploadCard(FrontImageBase64Encoded, null, null);
        }

        [TestMethod]
        [ExpectedException(typeof(ArgumentNullException),
            "FullContactApi was allowed to upload a card with a empty webhook url.")]
        public void FullContactCardReaderApiUploadCardEmptyWebhookUrl()
        {
            var fullContactCardReaderApi = new FullContactCardReaderApi();
            var actual = fullContactCardReaderApi.UploadCard(FrontImageBase64Encoded, null, " ");
        }
    }
}
